import React from "react"
import "./meme_style.css"


function MemeHeader() {
	return (
		<header>
			<img src="http://www.pngall.com/wp-content/uploads/2016/05/Trollface.png" alt="Problem?" />
			<p>Meme Generator</p>
		</header>
	)

}


export default MemeHeader
